A widget consists of two things: its settings and a build function. In Rust, this is just a struct with an impl WidgetBuilder. We're going to start simple, with a basic box on the screen: pub struct Button { } impl WidgetBuilder for Button { fn build(&self, ctx: &WidgetContext) -> BuildResult { BuildResult::Empty }
} If you run this... Nothing will happen. Which makes sense, as we don't have any widgets that actually render anything. Lets add one and give it a size. impl WidgetBuilder for Button { fn build(&self, ctx: &WidgetContext) -> BuildResult { build! { Drawable { layout: Layout { sizing: Sizing::Set { width: 64.0, height 32.0 } } } } }
} This should render a rectangle on screen that's 64x32 pixels. Pretty swick, if I do say so myself. Drawable is the most important primitive widget we have, as it's used to tell the renderer to actually draw something on screen. Without it, we have nothing. As long as you stick to Drawable, your widget should render exactly the same no matter where it's running. One important thing to note is clipping is not enabled by default. We'll cover why that is and the implications of that in a later section .

