Widgets may contain their own, self contained state, which persists across rebuilds (usually—more on that in a minute). Whenever the state changes, the widget's build() function will be re-invoked, and its children will be rebuilt. This is your main tool for implementing a user interface that can react to user events. Lets write up a quick counter example to demonstrate this: // Requires the `HoverPlugin` for the `Button` to function properly, so
// make sure you call `ui.init_plugin(HoveringPlugin::default);` # #[functional_widget]
fn counter_widget(ctx: &WidgetContext, font: FontId) -> BuildResult { let num = ctx.use_state(|| 0); build! { Column { children: [ Text::is(font, 32.0, format!("clicked: {} times", num.read())), Button { child: Padding { padding: Margin::All(10.0.into()), child: Text::is(font, 32.0, "A Button".into()) }, on_pressed: Callback::from(move |()| { *num.write() += 1; }) } ] } }
} Any time you use num.write(), it will cause any listening widgets to be rebuilt on the next update, so ensure you only call it when you actually change something. The first time ctx.use_state(|| 0) is used, the closure within the method is called to initialize the state. In this case, it will be initialized to zero. On subsequent rebuilds of the widget, the previous state that it was in will be persisted. However, this only applies if the parent of the widget is not rebuilt. If you want to create state, but not listen to changes to it, you can instead use ctx.init_state(|| 0). This is useful for widgets that manage state that children respond to, but state that itself doesn't react to. If you were to use that, instead, the state will have changed internally, but you wouldn't see any change to the UI.

