Global acts much the same way as state, but it exists once in your application and is shared amongst all widgets, no matter how deep they are in your tree. # #[functional_widget]
fn widget_with_global(ctx: &WidgetContext) -> BuildResult { let state = ctx.use_global(|| 0); build! { Drawable { layout: Layout { sizing: Sizing::Set { width: 64.0, height 32.0 } } } }
} In this case, use_global will fetch the global state or initialize it to zero if it does not already exist.

